commits.content:
import type {
  Meta,
  StoryObj,
} from "@storybook/react";

const meta = {
  title: "UI/FloatingInput",
  component: FloatingInput,
  parameters: {
    backgrounds: {
      default: "white",
      values: [
        {
          name: "white",
          value: "#fff",
        },
        {
          name: "theme",
          value: "#6a44c8",
        },
      ],
    },
  },
} satisfies Meta<typeof FloatingInput>;

export default meta;

type Story = StoryObj<typeof meta>;

export const Primary: Story = {
  args: {
    label: "hello",
  },
};
